import{_ as e,c as a,o as i,a2 as l}from"./chunks/framework.D3KFGq5-.js";const p=JSON.parse(`{"title":"Filtering Operators","description":"RxJS's filtering operators are used to extract only the necessary data from the stream based on conditions and time, contributing to improved performance.","frontmatter":{"description":"RxJS's filtering operators are used to extract only the necessary data from the stream based on conditions and time, contributing to improved performance."},"headers":[],"relativePath":"en/guide/operators/filtering/index.md","filePath":"en/guide/operators/filtering/index.md","lastUpdated":1763074329000}`),r={name:"en/guide/operators/filtering/index.md"};function s(n,t,d,o,f,h){return i(),a("div",null,[...t[0]||(t[0]=[l('<h1 id="filtering-operators" tabindex="-1">Filtering Operators <a class="header-anchor" href="#filtering-operators" aria-label="Permalink to &quot;Filtering Operators&quot;">​</a></h1><p>RxJS&#39;s filtering operators are important tools for selecting only the necessary data from a stream and not letting unnecessary data through. This greatly improves the efficiency and performance of the application.</p><p>Filtering operators are a set of RxJS operators that sort the values in a stream, allowing only those that meet certain criteria to pass through. By controlling the flow of data and processing only the values you need, you can build an efficient data processing pipeline.</p><h2 id="list-of-operators" tabindex="-1">List of Operators <a class="header-anchor" href="#list-of-operators" aria-label="Permalink to &quot;List of Operators&quot;">​</a></h2><h3 id="◾-basic-filtering-operators" tabindex="-1">◾ Basic Filtering Operators <a class="header-anchor" href="#◾-basic-filtering-operators" aria-label="Permalink to &quot;◾ Basic Filtering Operators&quot;">​</a></h3><table tabindex="0"><thead><tr><th style="text-align:left;">Operator</th><th style="text-align:left;">Description</th></tr></thead><tbody><tr><td style="text-align:left;"><a href="./filter">filter</a></td><td style="text-align:left;">Only let through values that match the condition</td></tr><tr><td style="text-align:left;"><a href="./take">take</a></td><td style="text-align:left;">Get only the specified number of first values</td></tr><tr><td style="text-align:left;"><a href="./takeLast">takeLast</a></td><td style="text-align:left;">Get the specified number of last values</td></tr><tr><td style="text-align:left;"><a href="./takeWhile">takeWhile</a></td><td style="text-align:left;">Get values while the condition is met</td></tr><tr><td style="text-align:left;"><a href="./skip">skip</a></td><td style="text-align:left;">Skip the specified number of first values</td></tr><tr><td style="text-align:left;"><a href="./skipLast">skipLast</a></td><td style="text-align:left;">Skip the specified number of last values</td></tr><tr><td style="text-align:left;"><a href="./skipWhile">skipWhile</a></td><td style="text-align:left;">Skip values while the condition is met</td></tr><tr><td style="text-align:left;"><a href="./skipUntil">skipUntil</a></td><td style="text-align:left;">Skip values until another Observable fires</td></tr><tr><td style="text-align:left;"><a href="./first">first</a></td><td style="text-align:left;">Get the first value, or the first value that meets a condition</td></tr><tr><td style="text-align:left;"><a href="./last">last</a></td><td style="text-align:left;">Get the last value, or the last value that meets a condition</td></tr><tr><td style="text-align:left;"><a href="./elementAt">elementAt</a></td><td style="text-align:left;">Get the value at a specified index</td></tr><tr><td style="text-align:left;"><a href="./find">find</a></td><td style="text-align:left;">Find the first value that meets a condition</td></tr><tr><td style="text-align:left;"><a href="./findIndex">findIndex</a></td><td style="text-align:left;">Get the index of the first value that meets a condition</td></tr><tr><td style="text-align:left;"><a href="./ignoreElements">ignoreElements</a></td><td style="text-align:left;">Ignore all values and only pass through completions/errors</td></tr></tbody></table><h3 id="◾-time-based-filtering-operators" tabindex="-1">◾ Time-based Filtering Operators <a class="header-anchor" href="#◾-time-based-filtering-operators" aria-label="Permalink to &quot;◾ Time-based Filtering Operators&quot;">​</a></h3><table tabindex="0"><thead><tr><th style="text-align:left;">Operator</th><th style="text-align:left;">Description</th></tr></thead><tbody><tr><td style="text-align:left;"><a href="./debounceTime">debounceTime</a></td><td style="text-align:left;">Issue the last value if no input is received for a specified time</td></tr><tr><td style="text-align:left;"><a href="./throttleTime">throttleTime</a></td><td style="text-align:left;">Pass through the first value and ignore new values for the specified time</td></tr><tr><td style="text-align:left;"><a href="./auditTime">auditTime</a></td><td style="text-align:left;">Issue the last value after a specified time</td></tr><tr><td style="text-align:left;"><a href="./audit">audit</a></td><td style="text-align:left;">Control the period with a custom Observable and issue the last value</td></tr><tr><td style="text-align:left;"><a href="./sampleTime">sampleTime</a></td><td style="text-align:left;">Sample the latest value at specified time intervals</td></tr></tbody></table><h3 id="◾-condition-based-filtering-operators" tabindex="-1">◾ Condition-based Filtering Operators <a class="header-anchor" href="#◾-condition-based-filtering-operators" aria-label="Permalink to &quot;◾ Condition-based Filtering Operators&quot;">​</a></h3><table tabindex="0"><thead><tr><th style="text-align:left;">Operator</th><th style="text-align:left;">Description</th></tr></thead><tbody><tr><td style="text-align:left;"><a href="./distinct">distinct</a></td><td style="text-align:left;">Remove all duplicate values (output only unique values)</td></tr><tr><td style="text-align:left;"><a href="./distinctUntilChanged">distinctUntilChanged</a></td><td style="text-align:left;">Remove consecutive duplicate values</td></tr><tr><td style="text-align:left;"><a href="./distinctUntilKeyChanged">distinctUntilKeyChanged</a></td><td style="text-align:left;">Detect only changes in specific properties</td></tr></tbody></table><h2 id="practical-use-cases" tabindex="-1">Practical Use Cases <a class="header-anchor" href="#practical-use-cases" aria-label="Permalink to &quot;Practical Use Cases&quot;">​</a></h2><ul><li><a href="./practical-use-cases">Practical Use Cases</a> presents practical examples of combining multiple filtering operators (real-time search, infinite scrolling, etc.).</li></ul>',12)])])}const g=e(r,[["render",s]]);export{p as __pageData,g as default};
